import React from 'react';
import catImage from './image.cat.jpeg';

function HomePage() {
  return (
    <div>
      <div className='home'>
        <h2>Kei Nakamura</h2>
        <div className='home-aboutme'>
          <img src={catImage}/>
        </div>
      </div>
    </div>
  )
};

export default HomePage;
